description:
Drawn is the ninth studio album of Filipino singer-actress Regine Velasquez-Alcasid, released on August 1, 1998.This is the first album that the singer ventured into Soul and Rhythm &amp; Blues music coming from her previous Asian-pop appeal. It was executively produced by Mark J. Feist of the MJF Company and co-produced by Viva Records. The album is distributed in the Philippines by Viva Music Group. Mark J. Feist also arranged all the tracks, wrote &amp; co-wrote five songs and played instruments throughout. The album was certified 7x Platinum Award given by Philippine Association of the Record Industry (PARI) denoting the shipments in the Philippines of 240,000+ units sold.

